import { Mail, Home } from 'react-feather'

export default [{
        id: 'home',
        title: 'Home',
        icon: <Home size = { 20 }/>,
        navLink: '/home'
    },
    {
        id: 'secondPage',
        title: 'Second Page',
        icon: <Mail size = { 20 }/>,
        navLink: '/second-page'
    },
    {
        id: 'sgsoil',
        title: 'Sand and Soil Transportation Permits',
        icon: <Mail size = { 20 }/>,
        navLink: '/sgsoil'
    },
    {
      id: 'sgsoilHistory',
      title: 'Sand and Soil Transportation Permits History',
      icon: <Mail size = { 20 }/>,
      navLink: '/sgsoilHistory'
    },
    {
      id: 'timwood',
      title: 'Timber and Wood Transportation Permits',
      icon: <Mail size = { 20 }/>,
      navLink: '/timwood'
    },
    {
      id: 'timwoodHistory',
      title: 'Timber and Wood Transportation Permits History',
      icon: <Mail size = { 20 }/>,
      navLink: '/timwoodHistory'
   }
]
